css:
@-moz-document url-prefix("http://fsincere.free.fr/isn") {
#navigation {
    float: none;
    width: 100%;
    background: none;
    padding-bottom: 2em;
}
#navigation hr {
    display: none;
}
#navigation ul {
    padding: 0;
}
#navigation a {
    padding: 0;
    color: #fff;
}
.nav_actif,
.nav_actif a {
    border-radius: 0;
    background: none !important;
}
#navigation a:hover {
    background: #0000001c !important;
}

body {
    background: #1E1E1E;
}
#contenu {
    margin-left: 0;
    background: #2b2b2b;
    color: #FFF;
}
#contenu strong {
    color: #C2C2C2;
}
#contenu a,
#contenu a:hover,
#contenu a:focus {
    color: #A1C8D7;
}
#contenu img {
    box-shadow: none;
}

.python_to_html,
pre {
    background: #515151;
    color: #cacaca;
    box-shadow: none;
}
span[style="background:#FFFF66"] {
    background: #cacaca !important;
}
.style_10,
.style_11 {
    color: #cacaca;
}
.definition,
.style_9 {
    color: #93C2FF;
}
.stdout,
.style_14 {
    color: #C6C6FF;
}
.builtin,
.style_8 {
    color: #e889e8;
}
.comment,
.style_1 {
    color: #FF6565;
}
.stderr {
    color: #FF4545;
}
.shell {
    color: #f00;
}
.style_2 {
    color: #ffc14b;
}
}
